import fetch from "isomorphic-unfetch";

export const getProposalContent = gitlabProjectId => {
  return fetch(
    `${process.env.GITLAB_BASE_URL}/projects/${gitlabProjectId}/repository/files/README%2Emd/raw`
  );
};
